import React from 'react'
import { Button, TableRow, TableCell } from '@material-ui/core';
import { Field } from './TableList';


interface newProps {  
    fields: Field[]
    rowData: any
    onEditClicked: () => any
    onClickDelete: () => any
}



export const ListItemTest: React.FC<newProps> = ({rowData, fields, onClickDelete, onEditClicked}) => {

    return (
        <>
            <TableRow>
                { fields.map((field) => {
                     return (  <TableCell>{rowData[field.keyName]} </TableCell>)
                })}
                <TableCell>
                    <Button onClick={onEditClicked}>edit</Button>
                </TableCell>
                <TableCell>
                    <Button onClick={onClickDelete}>delete</Button>
                </TableCell>
            </TableRow>
        </>
    )
}
